import React, {useState, useEffect} from "react";
import './App.css'
function App() {
  const [data, setData] = useState([{}])
  const [file, setFile] = useState("")

  useEffect(() => {
    fetch("/members").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])

  return (
    <div className="page">
      {/* <h1 className="header">Merry Christmas!</h1> */}
      {/* <h2 className ="subtitle">Welcome to... your new site! For all your translation word count needs.</h2> */}

      {(typeof data.members === 'undefined') ? (
        <p>Loading...</p>
      ) : (
        data.members.map((member, i) => (
          <p key={i}>{member}</p>
        ))
      ) }


    </div>
  );
}

export default App;
